--  Table structure for `sys_menu`
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `PID` decimal(20,0) DEFAULT NULL COMMENT '父级编码',
  `NAME` varchar(32) DEFAULT NULL COMMENT '菜单名称',
  `URL` varchar(128) DEFAULT NULL COMMENT '链接地址',
  `STATUS` decimal(8,0) DEFAULT '1' COMMENT '状态（默认：显示 1：显示，0：隐藏）',
  `ORD` decimal(8,0) DEFAULT NULL COMMENT '同级排序',
  `IS_DEL` decimal(1,0) DEFAULT '1' COMMENT '是否已删除（默认：否 1：否，0：是）',
  `CREATE_ID` decimal(20,0) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` decimal(20,0) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COMMENT='系统菜单表';

