DROP TABLE IF EXISTS `t_address`;
CREATE TABLE `t_address` (
  `ID` bigint(20) NOT NULL COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `NAME` blob COMMENT '收货人姓名',
  `ADDRESS` blob COMMENT '收货地址',
