  `ID_DEFAULT` int(11) DEFAULT NULL COMMENT '是否当前默认1是0否',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `CITYID` bigint(20) DEFAULT NULL COMMENT '城市ID',
  `CITY_NAME` varchar(50) DEFAULT NULL,
  `PROV_NAME` varchar(50) DEFAULT NULL,
  `AREA_NAME` varchar(255) DEFAULT NULL,
  `AREAID` bigint(20) DEFAULT NULL,
  `PROVINCEID` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `inx_addr_customerid` (`CUSTOMERSID`) USING BTREE,
  KEY `inx_addr_cityid` (`CITYID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='配送地址';

