  `GR_PAYMENT_NUM` varchar(50) DEFAULT NULL COMMENT '分组-交易次数',
  `GR_PAYMENT_NUM_CUSTOM` varchar(50) DEFAULT NULL COMMENT '分组-交易次数-自定义',
  `GR_SUMPRICE` varchar(50) DEFAULT NULL COMMENT '分组-累计金额',
  `GR_SUMPRICE_CUSTOM` varchar(50) DEFAULT NULL COMMENT '分组-累计金额-自定义',
  `GR_UNIT_PRICE` varchar(50) DEFAULT NULL COMMENT '分组-平均客单价',
  `GR_UNIT_PRICE_CUSTOM` varchar(50) DEFAULT NULL COMMENT '分组-平均客单价-自定义',
  `GR_CUSTOMER_LAVEL` varchar(50) DEFAULT NULL COMMENT '分组-会员等级',
  `GR_ADDR_PROV` varchar(50) DEFAULT NULL COMMENT '分组-地区筛选-省',
  `GR_ADDR_CITY` varchar(50) DEFAULT NULL COMMENT '分组-地区筛选-市',
  `GR_CLIENT` varchar(50) DEFAULT NULL COMMENT '分组-下单终端',
  `GR_PRONAME` varchar(50) DEFAULT NULL COMMENT '分组-票品',
  `GR_CLASSA` varchar(50) DEFAULT NULL COMMENT '分组-类目A',
  `GR_CLASSB` varchar(50) DEFAULT NULL COMMENT '分组-类目B',
  `GR_PRONUM` varchar(50) DEFAULT NULL COMMENT '分组-商品件数',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  `EXECUTE_STATUS` int(1) DEFAULT '0' COMMENT '执行状态（0：正在分组；1：已分组）',
