  `EXPORT_FILE` bigint(20) DEFAULT NULL COMMENT '导出zip文件ID',
  `EXPORT_STATUS` int(1) DEFAULT '0' COMMENT '生成导出文件状态（0：未生成；1：正在生成；2：已生成）',
  PRIMARY KEY (`ID`)
