BEGIN;
INSERT INTO `t_customer_index` VALUES ('58', '0.30', '1', '1', 'RFM 模型由最近2一次消费（Recency）、消费频率（Frequency）、消费金额（Monetary）三个指标组成，多用于营销、电商等领域，是衡量客户价值和客户创利能力的重要工具和手段。', '1', '1', null, null, null, '1', '管理员', '2017-09-24 14:38:56'), ('59', '0.50', '2', '1', '消费激励策略是通过记录用户消费、充值金额来累计客户成长值，进而评估会员等级。', '1', '1', null, null, null, '1', '管理员', '2017-09-24 14:38:56'), ('60', '0.20', '3', '1', '会员活跃策略是通过记录用户分享、签到等行为来累计用户成长值，进而评估会员等级。', '1', '1', null, null, null, '1', '管理员', '2017-09-24 14:38:56');
COMMIT;

