--  Table structure for `t_customer_index_active`
-- ----------------------------
DROP TABLE IF EXISTS `t_customer_index_active`;
CREATE TABLE `t_customer_index_active` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `INDEX_ID` bigint(20) DEFAULT NULL COMMENT '策略ID',
  `ANUM` int(11) DEFAULT NULL COMMENT '次数',
  `AINDEX` int(11) DEFAULT NULL COMMENT '对应成长值',
  `ATYPE` int(11) DEFAULT NULL COMMENT '类型(1.每日签到成长值2.连续签到3.每次分享成长值4.最多可分享次数5.每次订阅成长值6.每天阅次数受益上限7.领卡成功)',
  `IS_ENABLE` int(11) DEFAULT '1' COMMENT '是否启用（默认：是 1：是，0：否）',
  `IS_DEL` decimal(1,0) DEFAULT '1' COMMENT '是否已删除（默认：否 1：否，0：是）',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 COMMENT='会员活跃策略';

-- ----------------------------
--  Table structure for `t_customer_index_recency`
-- ----------------------------
DROP TABLE IF EXISTS `t_customer_index_recency`;
CREATE TABLE `t_customer_index_recency` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `INDEX_ID` bigint(20) DEFAULT NULL COMMENT '策略ID',
  `MONETARY` decimal(20,2) DEFAULT NULL COMMENT '金额',
  `MINDEX` int(11) DEFAULT NULL COMMENT '对应成长值',
  `MTYPE` int(11) DEFAULT NULL COMMENT '规则类型(1每消费2一次性消费3.每充值4一次性充值)',
  `IS_ENABLE` int(11) DEFAULT '1' COMMENT '是否启用（默认：是 1：是，0：否）',
  `IS_DEL` decimal(1,0) DEFAULT '1' COMMENT '是否已删除（默认：否 1：否，0：是）',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='消费激励策略';

-- ----------------------------
--  Table structure for `t_customer_index_rfm`
-- ----------------------------
DROP TABLE IF EXISTS `t_customer_index_rfm`;
CREATE TABLE `t_customer_index_rfm` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `INDEX_ID` bigint(20) DEFAULT NULL COMMENT '策略ID',
  `RECENCY` int(11) DEFAULT NULL COMMENT '最近一次消费(单位：天)',
  `RINDEX` int(11) DEFAULT NULL COMMENT '最近一次消费成长值',
  `FREQUENCY` int(11) DEFAULT NULL COMMENT '消费频率（单位：次）',
  `FINDEX` int(11) DEFAULT NULL COMMENT '消费频率成长值',
  `MONETARY` decimal(20,2) DEFAULT NULL COMMENT '消费金额（单位：元）',
  `MINDEX` int(11) DEFAULT NULL COMMENT '消费金额成长值',
  `IS_LOSS` int(11) DEFAULT '0' COMMENT '负增长(默认0 ，0否1是)',
  `IS_DEL` int(11) DEFAULT '1' COMMENT '是否已删除（默认：否 1：否，0：是）',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='RFM等级成长值策略';

