-- ----------------------------
--  Table structure for `t_customer_note`
-- ----------------------------
DROP TABLE IF EXISTS `t_customer_note`;
CREATE TABLE `t_customer_note` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `NAME` varchar(100) DEFAULT NULL COMMENT '名称',
  `REMARK` varchar(500) DEFAULT NULL COMMENT '说明',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='会员便签-会员信息下面的小标签';

-- ----------------------------
--  Table structure for `t_customer_prize`
-- ----------------------------
DROP TABLE IF EXISTS `t_customer_prize`;
CREATE TABLE `t_customer_prize` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `CUSTOMER_ID` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `PRIZE_ID` bigint(20) DEFAULT NULL COMMENT '奖品ID',
  `STATUS` int(11) DEFAULT '0' COMMENT '兑奖状态(1已兑奖0未兑奖)',
  `EXPRESS_NO` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '快递单号',
  `EXPRESS_TYPE` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '快递类型（数据字典）',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  `HIT` int(1) DEFAULT '1' COMMENT '抽中(170906字段弃用)',
  `EXPRESS_ADDRESS` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '收货地址',
  `ACTIVTY_ID` bigint(20) DEFAULT NULL COMMENT '活动ID',
  `CONSIGNEE` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '收货人',
  `ADDRESS_PHONE` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '联系电话',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=635 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='获奖信息';

