  `BE_ACCESS_ETIME` datetime DEFAULT NULL COMMENT '专题访问时间区间-结束',
  `BE_SHARE_ETIME` datetime DEFAULT NULL COMMENT '分享结束时间',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `propertys_lable_id` (`LABLE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=138 DEFAULT CHARSET=utf8 COMMENT='会员属性';

-- ----------------------------
--  Table structure for `t_customers`
-- ----------------------------
DROP TABLE IF EXISTS `t_customers`;
CREATE TABLE `t_customers` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户流水ID  票点/联盟 流水ID',
  `TRUENAME` blob COMMENT '用户真实名称, 票点/联盟 名称',
  `PASSWORD` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户密码,联盟用户登陆密码',
  `SEX` varchar(5) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户性别 1 男 2女',
  `EMAIL` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户邮箱',
  `REGDATE` datetime DEFAULT NULL COMMENT '用户出生日期',
  `NICKNAME` blob COMMENT '用户昵称',
  `CARDTYPE` decimal(1,0) DEFAULT NULL COMMENT '用户证件类型（1 身份证 2 军官证 3 护照）',
  `CARD` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户证件号码',
  `USERTYPE` decimal(1,0) DEFAULT NULL COMMENT '用户类别（1 个人用户 2 企业用户 3 集团用户 4 关系用户 5 团购客户）',
  `DISCOUNTDETAILID` bigint(8) DEFAULT NULL COMMENT '用户角色折扣ID（T_DISCOUNTDETAIL 表 DISCOUNTDETAILID ）[当用户类型为票点时，该值为票点折扣值对应的折扣ID,票点取票时，如果存在该值，则忽略票价表中的票点折扣]',
  `IP` varchar(80) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户最后登录IP',
  `REGEMAIL` decimal(1,0) DEFAULT NULL COMMENT '用户邮箱是否验证（1 是 0 否）',
  `PHONE` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户手机,票点/联盟 点联系人手机',
  `TEL` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户电话,票点/联盟 电话',
  `INTEGRAL` decimal(8,0) DEFAULT NULL COMMENT '用户积分',
  `NUM` decimal(8,0) DEFAULT NULL COMMENT '用户登录次数',
  `BUYNUM` decimal(8,0) DEFAULT NULL COMMENT '用户购买次数',
  `MALICE` decimal(8,0) DEFAULT NULL COMMENT '用户恶意退票次数',
  `INFO` varchar(1000) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户备注',
  `STATUS` decimal(1,0) DEFAULT NULL COMMENT '逻辑删除（1 删除锁定状态 0  有效）',
  `CREATETIME` datetime DEFAULT NULL COMMENT '增加时间,票点/联盟 增加时间',
  `LASTTIME` datetime DEFAULT NULL COMMENT '最后修改时间,票点/联盟 最后修改时间',
  `LASTUSER` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '最后修改人,票点/联盟 最后修改人',
  `DISCOUNTID` decimal(8,0) DEFAULT NULL COMMENT '用户角色id',
  `RENEWAL` decimal(22,2) DEFAULT '0.00' COMMENT '用户预存款, 票点 预存款',
  `RENEWALPWD` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户预存款密码 默认是228228, 票点 预存款密码预存款支付时使用 默认是228228',
  `OLDUSERID` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '旧数据库中用户ID',
  `OLDMARK` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '旧数据库中的分类',
  `UNIONUSERID` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '联盟用户的ID',
  `FCONFIGID` decimal(8,0) DEFAULT NULL COMMENT '票点 分站城市流水ID',
  `TNUMBER` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点/联盟 编号（票点已弃用，票点编号即票点流水ID）',
  `LEVELS` decimal(1,0) DEFAULT NULL COMMENT '票点 是否现金提票（1 是 0 否）',
  `AMOUNT` decimal(18,4) DEFAULT NULL COMMENT '票点 赊销额度',
  `LNAME` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点/联盟 联系人',
  `ADRESS` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点/联盟 地址',
  `EFFECT` decimal(1,0) DEFAULT NULL COMMENT '票点/联盟 是否有效（1 是 0 否）',
  `CODE` varchar(10) CHARACTER SET utf8 DEFAULT NULL COMMENT '联盟 邮编',
  `UNIONDISCOUNT` decimal(5,0) DEFAULT NULL COMMENT '联盟 折扣：永乐提供给第三方的折扣',
  `THIRDDISCOUNT` decimal(5,0) DEFAULT NULL COMMENT '联盟 第三方折扣：第三方返还的折扣（所得金额为第三方网站所得）',
  `USERDISCOUNT` decimal(5,0) DEFAULT NULL COMMENT '联盟 用户折扣：第三方网站给用户的折扣',
  `CITYID` decimal(8,0) DEFAULT NULL COMMENT '联盟 城市流水ID',
  `TYPE` decimal(5,0) NOT NULL DEFAULT '0' COMMENT '类别（0 用户 1 票点 2 联盟 3 新联盟）',
  `LEGALPERSON` varchar(127) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点/联盟 法人代表 2011-08-13 dj添加',
  `BUSINESSDATE` datetime DEFAULT NULL COMMENT '票点/联盟 开业时间 2011-08-13 dj添加',
  `STARCAPITAL` decimal(18,4) DEFAULT NULL COMMENT '票点/联盟 注册本金（单位：万元） 2011-08-13 dj添加',
  `EMPLOYEENUM` decimal(7,0) DEFAULT NULL COMMENT '票点/联盟 员工数量 2011-08-13 dj添加',
  `ASSET` decimal(18,4) DEFAULT NULL COMMENT '票点/联盟 资产总额（单位：万元） 2011-08-13 dj添加',
  `YYZZURL` varchar(1000) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点 营业执照复印件 文件URL',
  `SFZURL` varchar(1000) CHARACTER SET utf8 DEFAULT NULL COMMENT '票点 身份证复印件 文件URL',
  `USERNAME` blob COMMENT '联盟用户登陆用户名',
  `NATIVEPLACE` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '籍贯',
  `CUSTOMERCITY` blob COMMENT '用户所在城市',
  `DATASOURCE` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '资料来源',
  `CUSTOMERSOURCE` decimal(2,0) DEFAULT NULL COMMENT '客户来源  1:电话 2:网络 3:网点 4:邮件 5:短信',
  `INDUSTRY` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '所属行业',
  `POSITION` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '职位',
  `INCOMELEVELS` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '收入水平',
  `INCOMERANGE` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '家庭月收入范围',
  `BUYPURPOSE` decimal(1,0) DEFAULT NULL COMMENT '购买目的  1:自用 2:公司 3:赠送 4:其它',
  `BUYFREQUENCY` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '购买频率',
  `TICKETPRICE` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '喜欢价位',
  `ATTENTIONSTAR` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '全家关注明星',
  `MARITALSTATUS` decimal(1,0) DEFAULT NULL COMMENT '婚姻状况 1:已婚 2:未婚',
  `ISCHILDREN` decimal(1,0) DEFAULT NULL COMMENT '有无子女 1:有 2:无',
  `CHILDRENBIRTHDAY` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '子女生日',
  `ISINTERNET` decimal(1,0) DEFAULT NULL COMMENT '是否上网 1:是 2:否',
  `ATTENTIONTYPE` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '关注节目  1:演唱会  2:音乐会  2:话剧舞台剧  4:舞蹈芭蕾  5:戏曲综艺  6:儿童亲子  7:休闲娱乐  8:体育赛事(多个关注间以,号分割)',
  `INTERESTS` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '兴趣爱好  1:明星  2:音乐  3:影视  4:运动(多个关注间以,号分割)',
  `INTERESTSOTHER` varchar(250) CHARACTER SET utf8 DEFAULT NULL COMMENT '其他兴趣爱好',
  `BIRTHDAY` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '生日',
  `CURRENTAMOUNT` decimal(8,0) DEFAULT NULL COMMENT ' 票点赊销累计金额',
  `EDUCATION` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '学历',
  `UNIONSETTLEMENTDISCOUNT` decimal(8,3) DEFAULT NULL COMMENT '永乐给联盟的结算折扣【2012-12-17 添加 dj】',
  `ISRENEWAL` decimal(2,0) DEFAULT '0' COMMENT '预存款是否启用  0:未启用  1:启用',
  `REGPHONE` decimal(1,0) DEFAULT '0' COMMENT '电子钱包手机是否验证 0:未验证  1:已验证',
  `REGSAFETYINFO` decimal(1,0) DEFAULT '0' COMMENT '电子钱包安全问题是否验证 0:未验证  1:已验证',
  `LASTLOGINTIME` datetime DEFAULT NULL COMMENT '用户最后登录时间(每次登录时更新)',
  `UNIONTYPE` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '0:不享受,1:享受',
  `DISCOUNTTYPE` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '联盟目前所享受的折扣类型 0:永乐给用户折扣,1:联盟结算折扣',
  `LIMITSTARTTIME` datetime DEFAULT NULL COMMENT '永乐给用户的折扣值有效期开始日期',
  `LIMITENDTIME` datetime DEFAULT NULL COMMENT '永乐给用户的折扣值有效期结束日期',
  `SPREADTYPEID` decimal(8,0) DEFAULT NULL COMMENT '来源流水',
  `REGISTEREDSOURCE` decimal(5,0) DEFAULT NULL COMMENT '第三方注册来源【10：web，20：后台电话注册，30:wap， 40：安卓， 50：ios， 60：WEB联盟 70:WAP联盟】',
  `PHONE_SYS` decimal(3,0) DEFAULT NULL COMMENT '注册手机系统  1：android 2：ios ',
  `PHONE_MODEL` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '注册手机型号',
  `PHONE_VERSION` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '注册手机系统版本',
  `CLIENT_VERSION` varchar(20) CHARACTER SET utf8 DEFAULT NULL COMMENT '注册客户端系统版本',
  `CHANNEL_ID` bigint(20) DEFAULT NULL COMMENT '注册渠道名称',
  `HEADIMG` varchar(1000) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户头像',
  `DEVICETOKEN` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '设备推送token',
  `LASTLOGINPHONETYPE` decimal(2,0) DEFAULT NULL COMMENT '最后一次登录手机设备类型，1:Android, 2:ios',
  `ACCS_FLAG` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `UNIONKEY` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '联盟KEY1111',
  `ERROR_CHANNEL_NAME` varchar(50) CHARACTER SET utf8 DEFAULT NULL COMMENT '客户端注册渠道异常渠道名称(T_CHANNEL表en_name字段)',
  `IOS_IDFA` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT 'IOS客户端IDFA',
  `LAST_LOGIN_CHANNEL` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户最后一次登登录渠道',
  `IFALIPAY` decimal(8,0) DEFAULT '0' COMMENT '是否支付宝实名认证用户',
  `SPREADWAY` decimal(2,0) DEFAULT NULL COMMENT '推广方式 ：8:联盟跳转、9:联盟平台、10:CPS',
  `GRADE_NAME` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '用户等级',
  `GRADE_ID` bigint(20) DEFAULT '0' COMMENT '用户等级表ID',
  `CINDEX_UPDDATE` datetime DEFAULT NULL COMMENT '成长值更新时间',
  `SHIELD` int(11) DEFAULT '0' COMMENT '营销屏蔽，0：未屏蔽，1：屏蔽',
  `SYS_SOURCE` varchar(50) CHARACTER SET utf8 DEFAULT 'SYS_SOURCE_PIAOWU' COMMENT '会员系统来源-具体类型见数据字典-CUSTOMER_SYS_SOURCE',
  `WEIBO_NO` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '微博账号',
  `WEIXIN_NO` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '微信号',
  `ACTIVE_INDEX` float(20,2) DEFAULT '0.00' COMMENT '会员活跃成长值',
  `RECENCY_INDEX` float(20,2) DEFAULT '0.00' COMMENT '消费成长值',
  `RFM_INDEX` float(20,2) DEFAULT '0.00' COMMENT 'RFM成长值',
  `CINDEX` float(20,4) DEFAULT '0.0000' COMMENT '总成长值',
  `GRAGE_UPDATE_LAST` datetime DEFAULT NULL COMMENT '最后一次更新用户等级的时间',
  `CRM_INTEGRAL_SYS` int(11) DEFAULT '0' COMMENT '系统计算用户总积分',
  `CRM_INTEGRAL_OPT` int(11) DEFAULT '0' COMMENT '用户积分 CRM 认为操作可用的',
  `CRM_INTEGRAL_STATUS` int(11) DEFAULT '1' COMMENT '积分启用禁用方式1启用0禁用',
  `CRM_INTEGRAL_CONSUME` int(11) DEFAULT '0' COMMENT '系统消耗积分',
  `CRM_INTEGRAL_USABLE` int(11) DEFAULT '0' COMMENT '可用积分',
  `QQNUM` varchar(11) COLLATE utf8_bin DEFAULT NULL COMMENT 'QQ号',
  `CONSTELLATION` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '星座',
  `PWSYSID` bigint(20) DEFAULT NULL COMMENT '永乐票务系统接入的用户ID',
  `SYS1ID` bigint(20) DEFAULT NULL COMMENT '备用字段 其他系统接入的用户ID',
  `SYS2ID` bigint(20) DEFAULT NULL COMMENT '备用字段 其他系统接入的用户ID',
  `SYS3ID` bigint(20) DEFAULT NULL COMMENT '备用字段 其他系统接入的用户ID',
  `USERID_TOKEN` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `IDX$$_11E040001` (`PHONE`,`PASSWORD`),
  KEY `i_tc_create` (`CREATETIME`),
  KEY `l_tc_SHIELD` (`SHIELD`),
  KEY `i_tc_cindex` (`CINDEX`) USING BTREE,
  KEY `i_tc_CRM_INTEGRAL_USABLE` (`CRM_INTEGRAL_USABLE`),
  KEY `i_tc_pwsysid` (`PWSYSID`) USING BTREE,
  KEY `i_tc_gradeid` (`GRADE_ID`),
  KEY `GRAGE_UPDATE_LAST_index` (`GRAGE_UPDATE_LAST`)
) ENGINE=InnoDB AUTO_INCREMENT=8818434 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='用户/联盟/票点 表';

