-- ----------------------------
--  Table structure for `t_ewallet`
-- ----------------------------
DROP TABLE IF EXISTS `t_ewallet`;
CREATE TABLE `t_ewallet` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `PAY_PRICE` decimal(20,2) DEFAULT NULL COMMENT '充值、消费金额',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '操作时间',
  `ORDER_ID` bigint(20) DEFAULT NULL COMMENT '相关单号',
  `BEFORE_PRICE` decimal(20,2) DEFAULT NULL COMMENT '操作前金额',
  `AFTER_PRICE` decimal(20,2) DEFAULT NULL COMMENT '操作后金额',
  `PAYMENT_ID` int(11) DEFAULT NULL COMMENT '字段弃用',
  `EWALLETPREPAIDID` int(11) DEFAULT NULL COMMENT '228 T_CUSTOMERSYCKLOG 表的ID ！',
  `ISCUMPUTING` int(1) NOT NULL DEFAULT '0' COMMENT '是否已做计算0否1是',
  `FLAG` int(11) DEFAULT NULL COMMENT '0 续费记录1 退款记录2消费记录',
  PRIMARY KEY (`ID`),
  KEY `IND_t_ewallet_customerid` (`CUSTOMERSID`),
  KEY `i_t_ewallet_computing` (`ISCUMPUTING`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3113 DEFAULT CHARSET=utf8 COMMENT='电子钱包使用记录';

-- ----------------------------
--  Table structure for `t_files`
-- ----------------------------
DROP TABLE IF EXISTS `t_files`;
CREATE TABLE `t_files` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `TYPE` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '文件类型',
  `PATH` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文件路径',
  `NAME` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '原文件名',
  `REF_NAME` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '引用文件名',
  `SIZE` bigint(20) DEFAULT NULL COMMENT '文件大小',
  `SUFFIX` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文件后缀',
  `NO` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '文件唯一编码',
  `ISWEBLOD` bit(1) DEFAULT NULL COMMENT '是否web项目目录下（ webroot下）',
  `RELATIVE_PATH` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '文件相对路径',
  `CREATE_ID` bigint(20) DEFAULT NULL COMMENT '创建用户ID',
  `CREATE_NAME` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '创建用户名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_ID` bigint(20) DEFAULT NULL COMMENT '变更用户ID',
  `UPDATE_NAME` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '变更用户名称',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '变更时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=370 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC COMMENT='所有文件存储';

-- ----------------------------
--  Table structure for `t_letong`
-- ----------------------------
DROP TABLE IF EXISTS `t_letong`;
CREATE TABLE `t_letong` (
  `ID` bigint(20) NOT NULL COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `CARDNO` varchar(200) DEFAULT NULL COMMENT '乐通卡号',
  `PAY_PRICE` decimal(20,2) DEFAULT NULL COMMENT '充值、消费金额',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '操作时间',
  `ORDER_ID` bigint(20) DEFAULT NULL COMMENT '相关单号',
  `BEFORE_PRICE` decimal(20,2) DEFAULT NULL COMMENT '操作前金额',
  `AFTER_PRICE` decimal(20,2) DEFAULT NULL COMMENT '操作后金额',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='乐通卡使用记录';

-- ----------------------------
--  Table structure for `t_orders_info`
-- ----------------------------
DROP TABLE IF EXISTS `t_orders_info`;
CREATE TABLE `t_orders_info` (
  `ID` bigint(20) NOT NULL COMMENT '订单流水ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `ORDER_SOURCE` int(11) DEFAULT NULL COMMENT '订单来源 1:电话,2:网络,3:票务前台用户,4:票务前台票点,5,特殊录入订单，50:联盟,60:乐票通,70:IOS,80:ANDROID,90:WAP',
  `ORDER_STATUS` varchar(100) DEFAULT NULL COMMENT '订单状态',
  `PAY_STATUS` varchar(50) DEFAULT NULL COMMENT '支付状态',
  `ORDER_SUMPRICE` decimal(20,2) DEFAULT NULL COMMENT '订单金额',
  `PROS` varchar(5000) DEFAULT NULL COMMENT '订单商品',
  `PROS_NUM` int(11) DEFAULT NULL COMMENT '商品数量',
  `PRO_TYPES` varchar(255) DEFAULT NULL COMMENT '涉及品类',
  `PRO_TYPESA` varchar(255) DEFAULT NULL COMMENT '涉及商品品类大类',
  `PRO_CITY` varchar(255) DEFAULT NULL COMMENT '演出城市',
  `ARTISTS_INTRODUCED` blob COMMENT '涉及艺人、团体',
  `SHOPING_TYPE` varchar(100) DEFAULT NULL COMMENT '购买方式',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '下单时间',
  `PAY_TIME` datetime DEFAULT NULL COMMENT '支付时间',
  `PS_TIME` datetime DEFAULT NULL COMMENT '物流到达时间',
  `REF_REMARK` blob COMMENT '退票原因',
  `REF_MALICE` int(11) DEFAULT NULL COMMENT '是否恶意退票(1是0否)',
  `SJZF_PRICE` decimal(20,2) DEFAULT NULL COMMENT '实际支付金额(用户点支付时到账的金额)(页面不展现，但已保存)(此金额不准确，弃用)',
  `REFUN_PRICE` decimal(20,2) DEFAULT NULL COMMENT '退款金额',
  `ADDRESSID` bigint(20) DEFAULT NULL,
  `ISCUMPUTING` int(1) NOT NULL DEFAULT '0' COMMENT '是否已做订单计算',
  PRIMARY KEY (`ID`),
  KEY `index_customerid` (`CUSTOMERSID`),
  KEY `i_order_pstatus` (`PAY_STATUS`),
  KEY `i_order_iscomputing` (`ISCUMPUTING`) USING BTREE,
  KEY `I_order_ostatus` (`ORDER_STATUS`) USING BTREE,
  KEY `i_order_addressid` (`ADDRESSID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易记录';

-- ----------------------------
--  Table structure for `t_payment_types`
-- ----------------------------
DROP TABLE IF EXISTS `t_payment_types`;
CREATE TABLE `t_payment_types` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `TYPE` varchar(255) DEFAULT NULL COMMENT '支付平台',
  `CARD_NO` varchar(500) DEFAULT NULL COMMENT '平台账号',
  `SUM_PRICE` decimal(20,2) DEFAULT NULL COMMENT '累计消费金额',
  `PAY_COUNT` int(20) DEFAULT NULL COMMENT '累计支付次数',
  `LAST_TIME` datetime DEFAULT NULL COMMENT '最近一次使用时间',
  `ORDERSID` bigint(20) DEFAULT NULL COMMENT '所属订单ID',
  `ISCUMPUTING` varchar(1) NOT NULL DEFAULT '0' COMMENT '是否已做计算',
  PRIMARY KEY (`ID`),
  KEY `i_paytype_customerid` (`CUSTOMERSID`) USING BTREE,
  KEY `i_paytype_iscomputing` (`ISCUMPUTING`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2176 DEFAULT CHARSET=utf8 COMMENT='支付方式统计';

-- ----------------------------
--  Table structure for `t_product`
-- ----------------------------
DROP TABLE IF EXISTS `t_product`;
CREATE TABLE `t_product` (
  `ID` bigint(20) NOT NULL COMMENT 'ID',
  `NAME` varchar(400) DEFAULT NULL COMMENT '商品名称',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `STATUS` varchar(50) DEFAULT NULL COMMENT '商品状态',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品表';

-- ----------------------------
--  Table structure for `t_shortage_record`
-- ----------------------------
DROP TABLE IF EXISTS `t_shortage_record`;
CREATE TABLE `t_shortage_record` (
  `ID` bigint(20) NOT NULL COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '登记时间',
  `PRODUCT_NAME` varchar(500) DEFAULT NULL COMMENT '登记商品',
  `PRODUCT_PIRCE` decimal(20,2) DEFAULT NULL COMMENT '票价',
  `PRODUCT_COUNT` int(11) DEFAULT NULL COMMENT '数量',
  `PRODUCT_TYPEA` varchar(255) DEFAULT NULL COMMENT '商品一级分类',
  `PRODUCT_TYPEB` varchar(255) DEFAULT NULL COMMENT '商品二级分类',
  `PERFORMER` varchar(1000) DEFAULT NULL COMMENT '主要艺人团体',
  `CITY_NAME` varchar(255) DEFAULT NULL COMMENT '演出城市',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='缺货登记信息';

-- ----------------------------
--  Table structure for `t_suggest`
-- ----------------------------
DROP TABLE IF EXISTS `t_suggest`;
CREATE TABLE `t_suggest` (
  `ID` bigint(20) NOT NULL COMMENT 'ID',
  `CUSTOMERSID` bigint(20) DEFAULT NULL COMMENT '用户流水ID （此处 ID [票点ID 用户ID]）',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '时间',
  `TYPE` varchar(500) DEFAULT NULL COMMENT '建议类型',
  `ORDERS_ID` int(11) DEFAULT NULL COMMENT '关联订单',
  `DESCRIPTION` blob COMMENT '意见内容',
  `SOLVE_DESC` varchar(5000) DEFAULT NULL COMMENT '后续跟进处理情况',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='意见建议';

-- ----------------------------
--  Table structure for `t_test`
-- ----------------------------
DROP TABLE IF EXISTS `t_test`;
CREATE TABLE `t_test` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(32) DEFAULT NULL COMMENT '姓名',
  `sex` int(1) DEFAULT NULL COMMENT '性别',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `mon` decimal(10,2) DEFAULT NULL COMMENT '账户金额',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

